import React from 'react';
import { useNavigate } from 'react-router-dom';
// Removed unused MapPin and Calendar imports to fix warnings
import { ArrowLeft, QrCode } from 'lucide-react';

const MyEvents = ({ registeredEvents = [] }) => {
  const navigate = useNavigate();

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }} />
        <h2 style={{ fontSize: '18px', fontWeight: 'bold', margin: 0 }}>My Events</h2>
        <div style={{ width: 24 }}></div>
      </header>

      <div style={styles.scrollArea}>
        <p style={styles.subHeader}>REGISTERED EVENTS ({registeredEvents.length})</p>
        
        {registeredEvents.map(event => (
          <div key={event.id} style={styles.ticketCard}>
            <div style={styles.ticketHeader}>
              <h3 style={styles.eventTitle}>{event.name}</h3>
              <span style={styles.statusBadge}>REGISTERED</span>
            </div>
            
            <div style={styles.dottedLine}></div>

            <div style={styles.ticketBody}>
              <div style={styles.infoRow}>
                <div style={styles.infoItem}>
                  <span style={styles.label}>Date</span>
                  <div style={styles.value}>{event.date}</div>
                </div>
                <div style={styles.infoItem}>
                  <span style={styles.label}>Venue</span>
                  <div style={styles.value}>{event.venue}</div>
                </div>
              </div>
              
              <div style={styles.qrContainer}>
                <QrCode size={60} color="#1e293b" />
                <p style={{ fontSize: '10px', color: '#94a3b8', marginTop: '4px' }}>Ticket ID: {event.ticketId}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

// ... styles remain the same as previous version
const styles = {
  container: { maxWidth: '375px', margin: '0 auto', backgroundColor: '#f8fafc', height: '100vh', display: 'flex', flexDirection: 'column', fontFamily: 'sans-serif' },
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '16px', backgroundColor: '#fff', borderBottom: '1px solid #f1f5f9' },
  scrollArea: { flex: 1, overflowY: 'auto', padding: '20px', paddingBottom: '100px' },
  subHeader: { color: '#94a3b8', fontSize: '12px', fontWeight: 'bold', marginBottom: '16px' },
  ticketCard: { backgroundColor: '#fff', borderRadius: '16px', marginBottom: '20px', overflow: 'hidden', border: '1px solid #f1f5f9', boxShadow: '0 4px 6px -1px rgba(0,0,0,0.05)' },
  ticketHeader: { padding: '16px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' },
  eventTitle: { margin: 0, fontSize: '16px', fontWeight: 'bold', color: '#1e293b' },
  statusBadge: { backgroundColor: '#5c5cfc', color: '#fff', fontSize: '10px', padding: '4px 8px', borderRadius: '6px', fontWeight: 'bold' },
  dottedLine: { borderTop: '2px dotted #f1f5f9', margin: '0 16px' },
  ticketBody: { padding: '16px' },
  infoRow: { display: 'flex', gap: '20px', marginBottom: '16px' },
  infoItem: { flex: 1 },
  label: { fontSize: '11px', color: '#94a3b8', display: 'block' },
  value: { fontSize: '13px', fontWeight: '600', color: '#1e293b', marginTop: '2px' },
  qrContainer: { textAlign: 'center', backgroundColor: '#f8fafc', padding: '16px', borderRadius: '12px' }
};

export default MyEvents;
